import axios from "../../myaxios";
import { useContext, useEffect, useState } from "react";
import MetaContext from "../../MetaContext";
import { useStations } from "../OSCEPage/hooks";
import { AnsweredStationDetails } from "../OSCEPage/types";
import styled from "styled-components";

type AnalysisProps = {
    answeredOsceDetails: AnsweredStationDetails[];
};
const Analysis = (props: AnalysisProps) => {
    const { SERVER_URL, token } = useContext(MetaContext);
    const [categories, updateCategories] = useState<string[]>([]);

    const getCategories = async () => {
        try {
            const categories = (await axios.get(SERVER_URL + "/osce/categories")).data
                .stations as string[];
            updateCategories(categories);
        } catch (e) {
            console.log(e);
        }
    };

    useEffect(() => {
        getCategories();
    }, []);

    return (
        <div>
            {categories.map(c => (
                <div style={{ display: "flex", alignItems: "center" }}>
                    <div style={{ width: "100px", overflow: "hidden" }}>{c}</div>
                    <OuterBar>
                        <InnerBar style={{ width: `{50}%` }} />
                    </OuterBar>
                </div>
            ))}
        </div>
    );
};

export default Analysis;

const OuterBar = styled.div`
    height: 10px;
    width: 100%;
    background-color: white;
`;

const InnerBar = styled.div`
    height: 10px;
    width: 100%;
    background-color: orange;
`;
